 // HEADER
$('#header').prepend(HTMLheaderName.replace('%data%', bio.name)+''+HTMLheaderRole.replace('%data%', 'Web Developer'));

// go over contact and append to #topContacts and #footerContacts element on page
for(var contact in bio.contacts){
  //using contact generic instead of static list
  $('#topContacts').append(HTMLcontactGeneric.replace('%data%', bio.contacts[contact]).replace('%contact%', contact));
  $('#footerContacts').append(HTMLcontactGeneric.replace("%data%", bio.contacts[contact]).replace("%contact%", contact));
}

// inserting profile picture
$('#header').append(HTMLbioPic.replace('%data%', 'data:image/jpeg;base64,'));
// welcome message
$('#header').append(HTMLwelcomeMsg.replace('%data%', 'Lorem ipsum dolor'));
// at a glance title
$('#header').append(HTMLskillsStart);
// at a glance list
$('#header').append('<ul>'+HTMLskills.replace('%data%', 'HTML, JavaScript, CSS, PHP, SQL, NoSQL')+'</ul>');

//WORK EXPERIENCE
$("#workExperience").append(HTMLworkStart);
for(var i = 0; i< work.jobs.length; ++i){
  var content = "";
  content += HTMLworkEmployer.replace('%data%', work.jobs[i].employer);
  content += HTMLworkTitle.replace('%data%', work.jobs[i].title);
  content += HTMLworkDates.replace('%data%', work.jobs[i].dates);
  content += HTMLworkLocation.replace('%data%', work.jobs[i].location);
  content += HTMLworkDescription.replace('%data%', work.jobs[i].description);
  $(".work-entry").append(content);
}

//PROJECTS
$("#projects").append(HTMLprojectStart);
for(var i = 0; i< projects.projects.length; ++i){
  var content = "";
  content += HTMLprojectTitle.replace('%data%', projects.projects[i].title);
  content += HTMLprojectDates.replace('%data%', projects.projects[i].dates);
  content += HTMLprojectDescription.replace('%data%', projects.projects[i].description);
  // verify if there are images for the project
  if(projects.projects[i].images.length){
    for(var j=0; j< projects.projects[i].images.length; ++j){
      content += HTMLprojectImage.replace('%data%', projects.projects[i].images[j]);
    }
  }
  $(".project-entry").append(content);
}

//EDUCATION
$("#education").append(HTMLschoolStart);
if(education.schools.length){
  for(var i = 0; i< education.schools.length; ++i){
    var content = "";
    content += HTMLschoolName.replace('%data%', education.schools[i].name);
    content += HTMLschoolDegree.replace('%data%', education.schools[i].degree);
    content += HTMLschoolDates.replace('%data%', education.schools[i].dates);
    content += HTMLschoolLocation.replace('%data%', education.schools[i].location);
    if(education.schools[i].majors.length){
      for(var j=0; j< education.schools[i].majors.length; ++j){
        content += HTMLschoolMajor.replace('%data%', education.schools[i].majors[j]);
      }
    }
    $(".education-entry").append(content);
  }
}
if(education.onlineCourses.length){
  for(var i = 0; i< education.onlineCourses.length; ++i){
    var content = "";
    content += HTMLonlineClasses;
    content += HTMLonlineTitle.replace('%data%', education.onlineCourses[i].title);
    content += HTMLonlineSchool.replace('%data%', education.onlineCourses[i].school);
    content += HTMLonlineDates.replace('%data%', education.onlineCourses[i].date);
    content += HTMLonlineURL.replace('%data%', education.onlineCourses[i].url);
    $(".education-entry").append(content);
  }
}

